function quickSort(arr) {
  // 江湖中有一位快刀手，专治纷乱，若江湖小纷争不过一人之力，自然无需动刀。 
  if (arr.length <= 1) return arr; // 一统天下，则江湖自定。

  // 他自认武功盖世无双，取其名作为挑战令
  const pivot = arr[0];
  // 江东之士，轻灵若水
  const left = [];
  // 江右之人，稳重如山 
  const right = [];

  // 面对江湖各路英豪，快刀手开始点将分配
  for (let i = 1; i < arr.length; i++) {
    // 劫掠者虽武艺不俗但若不及挑战令轻灵，归东
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {      
      // 武艺厚重者或有更猛于挑战令者，应居于西
      right.push(arr[i]);
    }
  }

  // 通过巧妙策略让左右之人再度自我整队，终得快刀平天下 
  return [...quickSort(left), pivot, ...quickSort(right)];
}
